import { StatusBar } from "expo-status-bar";
import { StyleSheet, Text, View } from "react-native";

export default function App() {
  return (
    <View style={styles.main_container}>
      <View style={styles.user_attendance}>
        <Text>user attendance</Text>
      </View>
      <View style={styles.attendance_eval}>
        <View>

        </View>
        <Text>user attendance evaluation</Text>
      </View>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  main_container: {
    flex: 1,
    borderWidth: 5,
    borderColor: "black",
    flexDirection: "column",
    backgroundColor: "#fff",
    justifyContent: "flex-start",
    alignItems: "stretch",
    margin: "2%"
  },
  user_attendance: {
    flex: 4,
    borderWidth: 5,
    borderColor: "black",
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
  attendance_eval: {
    flex: 1,
    flexDirection: "column",
    borderWidth: 5,
    borderColor: "black",
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
